import React, { Component } from 'react';
import './Header.css';

class Header extends Component{
    constructor(props){
        super(props)
        this.state = {
            videoURL: 'https://player.vimeo.com/video/173243312?title=0&portrait=0&byline=0&autoplay=1'
        }
    }
    render(){
        return(
            <header className="v-header-container">
                {/* <div className="fullscreen-video-wrap"> */}
                    {/* <video src="https://player.vimeo.com/video/173243312?title=0&portrait=0&byline=0&autoplay=1" autoplay="true" loop="true"></video> */}
                    <video id="background-video" loop autoPlay>
                        <source src={this.state.videoURL} type="video/mp4" />
                        <source src={this.state.videoURL} type="video/ogg" />
                        Your browser does not support the video tag.
                    </video>
                {/* </div> */}
            </header>
        )
    }
}

export default Header
